import {popup, share} from './InstallPopup.module.scss'

const InstallPopup = () => {

  return (
    <p style={{
      position: 'relative',
      zIndex: 99,
      top: 48,
      width: '100%',
      padding: '12px 24px'
      // background: 'rgba(255,255,255,0.5)',
      // backdropFilter: 'blur(10px)',
      // webkitBackdropFilter: 'blur(10px)',
      // textAlign: 'center'
    }}>
      If you'd like to stay up to date, install Digest by clicking on <img src="./images/share.svg"></img> followed by 'Add to homescreen'
    </p>
  )
}

export default InstallPopup
